import React from 'react'
import ReactDOM from 'react-dom'

import {
    App, Time
} from './components'

function Nav() {
    return (
    <header className='nav'>
    <nav>
        <ul className="navbar">
            <li>Pricing</li>
            <li>About</li>
            <li>Contact</li>
        </ul>
    </nav>
    </header>
    )
}

function Main(){
    return (
        <div className='main'>
        <h1 className='title'>Reasons I'm excited to learn React</h1>
        <ul className='details'>
            <li>It's a popular library!</li>
            <li>It may get me a job (Wow)</li>
            <li>It will be required</li>
        </ul>
        </div>
    )
}

function Footer(){
    return (
        <footer className='footer'>
            <small>2023 Rays Development.</small>
        </footer>
    )
}

ReactDOM.render(
    //<div><App/><Time/></div>,
    <><Nav /><Main/></>,
    document.getElementById('root')
)
